import Weather from "./Weather";

function App() {
  return (
    <div className="App">
      <div className="container">
        <Weather />
      </div>
      <p>
        <a href="">Open Source Code</a> by Jayani Chakravarti
      </p>
    </div>
  );
}

export default App;
